Class Filter {T : Type} (F : (T -> Prop) -> Prop) := {
 filter_true : F (fun _ => True) ;
 filter_and : forall P Q : T -> Prop, F P -> F Q -> F (fun x => P x /\ Q x) ;
 filter_imp : forall P Q : T -> Prop, (forall x, P x -> Q x) -> F P -> F Q
}.

