Record bijection (A B:Type) : Type := Bijection {
 bij_f: A -> B;
 bij_g: B -> A;
 bij_fg: forall x, bij_f (bij_g x) = x;
 bij_gf: forall x, bij_g (bij_f x) = x
}.

